const SearchBar = ({setSearched}) => {
    const location = location();

  useEffect(() => {
    props.setSearched("");
  }, [location.pathname]);

    const [translate, i18n] = useTranslation("global");
    return (
        <input type={"text"} placeholder={translate("search")} onChange={e => setSearched(e.target.value)}/>
    );
}

export default SearchBar;
